using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Web;

namespace Core.Common
{
    public static class FileProcess
    {
        private static string base64image = "data:image/png;base64,";
        public static string SaveImageFromBase64(string path, string base64String)
        {
            string extension = base64String.Substring(0, base64String.IndexOf(','));
            string baseString = base64image.Replace("data:image/png|tiff|jpg|gif;base64,", "");
            var bytes = Convert.FromBase64String(baseString);
            using (var imageFile = new FileStream($"C:\\D\\Images\\abc.{GetExtension(extension)}", FileMode.Create))
            {
                imageFile.Write(bytes, 0, bytes.Length);
                imageFile.Flush();
            }
            return path;
        }

        private static string GetExtension(string data)
        {
            if (data.Contains("png"))
                return "png";
            if (data.Contains("jpg"))
                return "jpg";
            return "jpg";
        }
    }
}
